    y[14] = c[14]*28.010550*CWinv; 
    y[15] = c[15]*44.009950*CWinv; 
    y[16] = c[16]*29.018520*CWinv; 
    y[17] = c[17]*30.026490*CWinv; 
    y[18] = c[18]*31.034460*CWinv; 
    y[19] = c[19]*31.034460*CWinv; 
    y[20] = c[20]*32.042430*CWinv; 
